import React from 'react'
import './styles.css'

function Scoresheet(props) {
    return (
        <div className="questionBox">
            <h1>Quiz Successfully Completed</h1>
            <h3>Your score is {props.score}</h3>
        </div>
    )
}

export default Scoresheet
